package com.xuyuan.extjs3.tree.bean;import java.util.List;public class Menu {	/**	 * @uml.property  name="id"	 */	private Integer id;	/**	 * @uml.property  name="text"	 */	private String text;	/**	 * @uml.property  name="link"	 */	private String link;	/**	 * @uml.property  name="cls"	 */	private String cls;	/**	 * @uml.property  name="leaf"	 */	private boolean leaf;	/**	 * @uml.property  name="children"	 * @uml.associationEnd  multiplicity="(0 -1)" elementType="com.xuyuan.extjs3.tree.bean.Menu"	 */	private List<Menu> children;		public Menu() {	}	public Menu(Integer id, String text, String cls, boolean leaf) {		this.id = id;		this.text = text;		this.cls = cls;		this.leaf = leaf;	}		/**	 * @return	 * @uml.property  name="id"	 */	public Integer getId() {		return id;	}	/**	 * @param id	 * @uml.property  name="id"	 */	public void setId(Integer id) {		this.id = id;	}	/**	 * @return	 * @uml.property  name="text"	 */	public String getText() {		return text;	}	/**	 * @param text	 * @uml.property  name="text"	 */	public void setText(String text) {		this.text = text;	}	/**	 * @return	 * @uml.property  name="leaf"	 */	public boolean isLeaf() {		return leaf;	}	/**	 * @param leaf	 * @uml.property  name="leaf"	 */	public void setLeaf(boolean leaf) {		this.leaf = leaf;	}	/**	 * @return	 * @uml.property  name="link"	 */	public String getLink() {		return link;	}	/**	 * @param link	 * @uml.property  name="link"	 */	public void setLink(String link) {		this.link = link;	}	public List<Menu> getChildren() {		return children;	}	public void setChildren(List<Menu> children) {		this.children = children;	}	/**	 * @return	 * @uml.property  name="cls"	 */	public String getCls() {		return cls;	}	/**	 * @param cls	 * @uml.property  name="cls"	 */	public void setCls(String cls) {		this.cls = cls;	}	}